import React from 'react';

class Video extends React.Component {
  state = {
    que: undefined
  }
  render () {
    return (
      <div>
      <input className="string" type="text" placeholder="Что хотите посмотреть?" value={this.state.searchQuery} onChange={this.textInputChange("searchQuery")}></input>
      <button className="button" onClick={this.gettingVideoId}>Найти</button>
      </div>
    )
  }
}

export default Video;
